  function clicou() {
    console.log("Botão da filha foi clicado!");
  }

  return (
    <div className="componente">
      <h1 className="titulo">Título: {props.titulo}</h1>
      <ComponenteFilha titulo="Filha"></ComponenteFilha>
    </div>
  );
}
